INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(380 , 12 , 1 , 'Aladino y la lmpara mgica  Haba una vez, en una ciudad de Arabia, un joven llamado Aladino. Viva con su madre en una pequea casa. Eran pobres, pero Aladino siempre soaba con ser rico.  Un da, un hombre extrao lleg a la ciudad. Este hombre era un mago malo. Dijo que era el to de Aladino y lo llev al desierto. All, el mago le mostr una cueva mgica.  Aladino, entra en la cueva y trae la lmpara que est dentro, dijo el mago.  Aladino entr en la cueva y encontr la lmpara. Pero cuando sali, el mago le pidi la lmpara antes de ayudarlo a salir de la cueva. Aladino no confi en l y no le dio la lmpara. Entonces, el mago, enojado, cerr la cueva, dejando a Aladino atrapado.  Aladino estaba triste y asustado. Mientras miraba la lmpara, la frot por accidente. De repente, un genio apareci!  Soy el genio de la lmpara. Cul es tu deseo?, dijo el genio.  Aladino pidi salir de la cueva, y el genio lo llev a casa con su madre. Ahora, con la lmpara mgica, Aladino y su madre vivan mejor. Aladino pidi al genio muchos deseos: una casa grande, ropa bonita, y comida deliciosa.  Un da, Aladino vio a la princesa en el mercado y se enamor de ella. Quera casarse con ella, as que pidi al genio que lo ayudara. El genio le dio regalos maravillosos para el sultn, y Aladino pudo casarse con la princesa.' , '7799DF73-4265-4620-83B1-7CD7D718F657' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(381 , 12 , 2 , 'Pero el mago malo regres. Quera la lmpara, as que enga a la princesa para que se la diera. Con la lmpara en sus manos, el mago us el poder del genio para llevarse todo lo que Aladino tena, incluso su palacio y la princesa.  Aladino estaba triste, pero no se rindi. Con la ayuda de un anillo mgico que tambin tena un genio, logr encontrar al mago. Enga al mago y recuper la lmpara. Aladino volvi a pedir sus deseos al genio, y todo regres a la normalidad.  Al final, Aladino y la princesa vivieron felices para siempre, y nunca ms usaron la lmpara mgica.' , '09AAA630-6299-48DB-850B-02AC812B0D43' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(382 , 13 , 1 , 'Cenicienta  Haba una vez una joven llamada Cenicienta. Ella viva con su madrastra y dos hermanastras. Ellas eran muy crueles con Cenicienta y la hacan trabajar todo el da limpiando la casa.  Un da, el prncipe organiz un gran baile en el palacio. Todas las jvenes del reino estaban invitadas. Las hermanastras de Cenicienta fueron al baile, pero no dejaron que Cenicienta fuera.  Cenicienta estaba muy triste. De repente, apareci su hada madrina. Con su varita mgica, transform un calabaza en un bonito carruaje, a los ratones en caballos, y a Cenicienta le dio un vestido precioso y unos zapatos de cristal. Pero le advirti que deba volver antes de la medianoche, porque a esa hora el hechizo se rompera.  Cenicienta fue al baile y el prncipe qued enamorado de ella. Bailaron toda la noche, pero cuando el reloj marc la medianoche, Cenicienta tuvo que salir corriendo. En su prisa, perdi uno de sus zapatos de cristal.  El prncipe, decidido a encontrarla, busc por todo el reino a la duea del zapato. Finalmente, lleg a la casa de Cenicienta. Las hermanastras intentaron ponerse el zapato, pero no les quedaba bien. Entonces, Cenicienta se lo prob, y le qued perfecto.  El prncipe y Cenicienta se casaron y vivieron felices para siempre.' , 'A0389E46-3B1A-4D21-AE65-66FD0C6593F4' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(383 , 14 , 1 , 'Ananse y la Olla de Sabidura  Haba una vez, en un pueblo lejano, una araa muy lista llamada Ananse. Un da, Ananse decidi que quera tener toda la sabidura del mundo para l solo. Entonces, fue al bosque y encontr una olla mgica que contena toda la sabidura.  Ananse estaba muy feliz. Pens: "Voy a guardar esta olla para m. Ser el ms sabio de todos."  Ananse llevaba la olla a casa, pero tena miedo de que alguien ms pudiera robarla. Entonces, decidi esconderla en lo alto de un rbol.  Ananse tom la olla y empez a subir al rbol. Pero tena un problema: llevaba la olla en el frente, y eso haca difcil subir. Ananse se resbalaba y no poda llegar a la cima.  Mientras Ananse intentaba subir, su hijo, que estaba mirando desde abajo, le dijo: "Pap, por qu no pones la olla en tu espalda? Ser ms fcil subir as."  Ananse se enfad. Pens: "Yo tengo toda la sabidura! Cmo es posible que mi hijo sepa algo que yo no s?"  Pero Ananse decidi probar el consejo de su hijo. Puso la olla en su espalda y pudo subir el rbol fcilmente.  Cuando lleg a la cima, se dio cuenta de que aunque tena la olla de sabidura, no lo saba todo. Entonces, Ananse entendi que la sabidura no se puede guardar en una sola persona. As que, en lugar de esconder la olla, la rompi y dej que la sabidura se esparciera por el mundo para que todos pudieran aprender.' , 'CC10E797-59D7-4094-8320-3D6E88C5A084' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(384 , 15 , 1 , '[GUION PARA VIDEO: EXPLICACIN DE "COMPREHENSIBLE INPUT" EN 5 MINUTOS]  [INTRO SEQUENCE]  Msica animada, fondo colorido con el ttulo "Comprehensible Input: El MEJOR Mtodo para Aprender un Idioma!"  [EN PANTALLA: Aparece el YouTuber sonriendo, de pie frente a un fondo simple con imgenes relacionadas con el aprendizaje de idiomas, como libros, nubes de palabras y banderas. Aparece el subttulo "Explicacin de Comprehensible Input".]  YouTuber  "Hola, qu tal, estudiantes de idiomas! Bienvenidos de nuevo al canal, donde hablamos de los MEJORES mtodos para aprender idiomas rpido y de forma efectiva. Si eres nuevo aqu, no olvides darle al botn de suscribirse y activar las notificaciones porque hoy vamos a hablar de una de las herramientas ms poderosas para aprender cualquier idioma: comprehensible input!"  [SECCIN 1: Qu es el Comprehensible Input?]  La msica de fondo se desvanece mientras aparecen visuales de texto y smbolos que representan el habla.  YouTuber  "Bien, entonces, qu es el comprehensible input o entrada comprensible? Puede que hayas escuchado este trmino si ests en el mundo del aprendizaje de idiomas. Es un mtodo popularizado por el lingista Stephen Krashen, que se basa en la idea de que aprendemos mejor un idioma cuando entendemos lo que estamos escuchando o leyendo, aunque no sepamos cada palabra.' , '0A2D56CE-3C90-4F5D-8B59-B8ED4D8F065E' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(385 , 15 , 2 , 'El comprehensible input bsicamente significa exponerse a un idioma que est un poco por encima de tu nivel actual. No demasiado fcil, porque no te desafiara, pero tampoco tan difcil que te pierdas por completo. Pinsalo como escalones: necesitas contenido que te rete, pero que an est al alcance."  [EN PANTALLA: Aparece un texto breve para enfatizar]  "Contenido que puedes entender en su mayora, con algunas palabras y estructuras nuevas!"  [SECCIN 2: Por qu es tan efectivo?]  La cmara hace un leve zoom para dar nfasis.  YouTuber  "Ahora, djame explicarte por qu este mtodo funciona tan bien. Cuando te expones a un idioma en su contextoya sea escuchando o leyendotu cerebro empieza a captar patrones de manera natural. Absorbes reglas gramaticales, estructuras de frases y vocabulario sin darte cuenta. En lugar de memorizar largas listas de palabras o reglas gramaticales, aprendes por experiencia.  Es como los nios aprenden su primer idioma! Ellos no estudian, verdad? Solo escuchan mucho lenguaje a su alrededor, y poco a poco entienden ms hasta que hablan con fluidez. Eso es exactamente lo que haces con el comprehensible input: exponerte al idioma de una manera que se siente natural."  [SECCIN 3: Cmo encontrar buen Comprehensible Input?]' , '1D260D4C-E862-4E70-AD0F-8C1B859724A9' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(386 , 15 , 3 , 'La msica animada vuelve mientras la escena cambia a mostrar varios formatos de medios (libros, videos, aplicaciones) en pantalla.  YouTuber  "Entonces, cmo puedes encontrar t comprehensible input para tu camino en el aprendizaje de idiomas? Es ms fcil de lo que piensas! Puedes usar todo tipo de materiales, siempre y cuando se ajusten a tu nivel:  Lecturas graduadas: Son libros escritos especficamente para estudiantes, con vocabulario y gramtica ajustados a tu nivel.  Libros infantiles: No los subestimes! Suelen ser simples y estn llenos de lenguaje til.  Podcasts o videos para principiantes: Hay muchsimos podcasts y canales de YouTube diseados para ensear a los principiantes a travs de conversaciones reales.  Series con subttulos: Encuentra programas o videos en YouTube en tu idioma objetivo que te gusten. Empieza con subttulos en tu propio idioma, y luego cambia a subttulos en el idioma que ests aprendiendo a medida que mejoras.  Aplicaciones de idiomas: Algunas aplicaciones ofrecen contenido adaptado a tu nivel, como ejercicios de escucha graduados o historias. Duolingo, LingQ y FluentU son grandes ejemplos."  [EN PANTALLA: Aparecen ejemplos]  Lecturas Graduadas  Podcasts para Principiantes  Libros Infantiles  Series con Subttulos  Aplicaciones de Idiomas (Duolingo, LingQ, FluentU)  YouTuber' , 'B7A6E944-AF3A-4831-9281-AB9F5516CE68' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(387 , 15 , 4 , '"Recuerda, el objetivo es poder seguir el contenido la mayor parte del tiempo, aunque haya algunas cosas que todava no entiendas. As es como progresas!"  [SECCIN 4: Mis Consejos Personales para Usar Comprehensible Input]  El YouTuber gesticula hacia la cmara, aadiendo un toque personal.  YouTuber  "Bien, aqu tienes algunos de mis consejos personales para sacar el mximo provecho del comprehensible input:  No te preocupes por entender todo. En serio, est bien si no entiendes cada palabra. Concntrate en captar el significado general.  La repeticin es clave. Si encuentras algo que te gusta y que entiendes en su mayora, escchalo o lelo de nuevo! Captars ms cosas la segunda o tercera vez.  Elige contenido que te interese. Cuanto ms disfrutes lo que ests aprendiendo, ms tiempo pasars hacindolo. Te gusta la cocina? Mira programas de cocina en tu idioma objetivo. Te gustan los deportes? Sigue un podcast de deportes. Hace que aprender sea mucho ms divertido!  Fjate metas pequeas. En lugar de intentar ver una pelcula entera, empieza con videos o podcasts cortosde cinco o diez minutos. Ve aumentando gradualmente."  [EN PANTALLA: Lista rpida de consejos para dar nfasis]  No te preocupes por entender todo  Repite contenido  Elige temas que disfrutes  Fjate metas pequeas  [CONCLUSIN: El Poder del Comprehensible Input]' , 'E04E371B-1EE8-4B28-BEC1-A322E90E45D7' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(388 , 15 , 5 , 'La cmara se aleja nuevamente, mientras la msica animada vuelve.  YouTuber  "Para resumir, el comprehensible input es una herramienta increble para aprender idiomas. Te ayuda a absorber vocabulario y gramtica de manera natural y, lo ms importante, mantiene el proceso de aprendizaje divertido y motivador. As que sal ah y comienza a escuchar, ver y leer en tu idioma objetivo!"  [EN PANTALLA: Aparece un texto alentador]  "Cuanto ms te sumerjas, ms aprenders!"  YouTuber  "Si te ha gustado este video, dale un like y cuntame en los comentarios qu idioma ests aprendiendo y qu materiales te han sido tiles. No olvides suscribirte para ms consejos y trucos de aprendizaje de idiomas, y nos vemos en el prximo video! Hasta luego!"  [SECUENCIA FINAL]  La msica se desvanece mientras aparece en la pantalla "Gracias por ver! Suscrbete para ms!"  Ah tienes el guion en espaol! Est diseado para ser dinmico y fcil de entender para los estudiantes de idiomas.' , '689B3DC8-E9A7-4BD7-8962-DC6EB60CA23C' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(389 , 16 , 1 , 'Golpe de Estado en Espaa de 1981  El golpe de Estado de 1981, tambin conocido por el numernimo 23F,? fue un intento fallido de golpe de Estado perpetrado el lunes 23 de febrero de 1981 por algunos mandos militares en Espaa. Los hechos principales sucedieron en las ciudades de Valencia y Madrid.  En Madrid, a las 18:23 horas, un numeroso grupo de guardias civiles a cuyo mando se encontraba el teniente coronel Antonio Tejero asalt el Palacio de las Cortes durante la votacin para la investidura del candidato a la Presidencia del Gobierno, Leopoldo Calvo-Sotelo, hasta entonces vicepresidente segundo del Gobierno y diputado de la Unin de Centro Democrtico (UCD). Los diputados y el Gobierno de Espaa al completo fueron secuestrados en su interior.  La ciudad de Valencia fue ocupada militarmente, en virtud del estado de excepcin proclamado por el teniente general Jaime Milans del Bosch, capitn general de la III regin militar. Dos mil hombres y cincuenta carros de combate fueron desplegados en las calles de la ciudad.' , '667EAB53-7928-4EB0-9FBF-CAEB1403299C' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(390 , 16 , 2 , 'A las 21 horas de ese mismo da, el diario El Pas puso en la calle una edicin especial posicionndose contra el golpe con el titular en primera plana: El Pas, con la Constitucin.? A la una de la madrugada del 24 de febrero, el rey Juan Carlos I, vestido con uniforme de capitn general de los Ejrcitos, se dirigi a la nacin por televisin para situarse en contra de los golpistas y defender la Constitucin espaola. Poco despus, Milans dio la orden de regresar a sus unidades a los contingentes militares que ocupaban Valencia. El secuestro del Congreso termin a medioda del da 24.  El Tribunal Supremo, en casacin, conden a 30 aos de crcel a Milans, Tejero y Alfonso Armada como principales responsables del golpe de Estado. En total fueron condenados doce miembros de las Fuerzas Armadas, diecisiete miembros de la Guardia Civil y un civil. Menos Tejero, todos ellos salieron de la prisin antes del ao 1990 (el general Armada gracias a un indulto).  Como ha destacado Juan Francisco Fuentes, el estrepitoso fracaso del golpe trajo consigo la consolidacin de una democracia tambaleante y la derrota definitiva del golpismo, del que puede decirse que ya nunca levant cabeza.? El 23-F fue el resultado de una tradicin militarista que muri con l, aade Fuentes.' , 'A5A50EE6-28A4-4634-B5CA-F8ECCBE2CF9D' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(391 , 17 , 1 , 'Espaa, formalmente Reino de Espaa,nota 1? es un pas soberano transcontinental, constituido en Estado social y democrtico de derecho y cuya forma de gobierno es la monarqua parlamentaria. Es uno de los veintisiete Estados soberanos que forman la Unin Europea. Su territorio, con capital en Madrid,30? est organizado en diecisiete comunidades autnomas, formadas a su vez por cincuenta provincias, y dos ciudades autnomas.' , 'D3B9EBA6-C4AF-4A52-ABEB-904B48511FD5' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(392 , 17 , 2 , 'Espaa se sita principalmente en el suroeste de Europa, si bien tambin tiene presencia en el norte de frica. En Europa, ocupa la mayor parte de la pennsula ibrica, conocida como Espaa peninsular, y las islas Baleares (en el mar Mediterrneo). En frica se hallan las ciudades de Ceuta y Melilla, las islas Canarias (en el ocano Atlntico) y varias posesiones mediterrneas denominadas plazas de soberana. El municipio de Llivia, en los Pirineos, constituye un exclave rodeado totalmente por territorio francs. Completa el conjunto de territorios una serie de islas e islotes frente a las propias costas peninsulares. Tiene una extensin de 505 370 km2,11? por lo que es el cuarto pas ms extenso del continente,nota 2? y con una altitud media de 650 m sobre el nivel del mar, uno de los pases ms montaosos de Europa. Su poblacin casi llega a los 48 millones y medio de habitantes, aunque la densidad de poblacin es reducida si se compara con el contexto europeo.31?32? Concretamente, a 1 de julio de 2024 lleg hasta los 48 797 897.13? El territorio peninsular comparte fronteras terrestres con Francia y con Andorra al norte, con Portugal al oeste y con Gibraltar al sur. En sus territorios africanos, comparte fronteras terrestres y martimas con Marruecos. Comparte con Francia la soberana sobre la isla de los Faisanes en la desembocadura del ro Bidasoa y cinco faceras pirenaicas.33?' , '5BD67690-B9A8-4EAF-BB39-BAD7F406FE42' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(393 , 17 , 3 , 'El artculo 3.1 de su Constitucin establece que el castellano es la lengua espaola oficial del Estado. Todos los espaoles tienen el deber de conocerla y el derecho a usarla.3? En 2012, era la lengua materna del 82 % de los espaoles.34? Segn el artculo 3.2, las dems lenguas espaolas sern tambin oficiales en las respectivas Comunidades Autnomas de acuerdo con sus Estatutos.3? El idioma espaol o castellano, segunda lengua materna ms hablada del mundo con 500 millones de hispanohablantes nativos, y hasta casi los 600 millones incluyendo hablantes con competencia limitada,35? es uno de los ms importantes legados del acervo cultural e histrico de Espaa en el mundo. Perteneciente culturalmente a la Europa Latina y heredero de una vasta influencia grecorromana, Espaa alberga tambin la cuarta coleccin ms numerosa del mundo de sitios declarados Patrimonio de la Humanidad por la Unesco.36?' , '2740ACA8-B5F3-4B3F-AB6C-402E87B66ADB' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(394 , 17 , 4 , 'Es un pas desarrollado goza de la cuarta esperanza de vida ms elevada del mundo y de altos ingresos, cuyo producto interior bruto coloca a la economa espaola en la decimocuarta posicin mundial (2021).37? Espaa es una gran potencia turstica, ya que destaca como el segundo pas ms visitado del mundo ms de 83 millones de turistas en 2019 y el segundo pas del mundo en ingresos econmicos provenientes del turismo internacional.38?39? Tiene un ndice de desarrollo humano muy alto (0,911), segn el informe de 2022 del Programa de la ONU para el Desarrollo.15? Espaa tambin tiene una notable proyeccin internacional a travs de su pertenencia a mltiples organizaciones internacionales como Naciones Unidas, el Consejo de Europa, la Organizacin Mundial del Comercio, la Organizacin de Estados Iberoamericanos, la OCDE, la OTAN y la Unin Europea incluidos dentro de esta al espacio Schengen y la eurozona, adems de ser miembro de facto del G20.' , 'DD2199D4-3378-4824-9A26-088BC4924557' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(395 , 17 , 5 , 'La primera presencia constatada de homnidos del gnero Homo se remonta a 1,2 millones de aos antes del presente, como atestigua el descubrimiento de una mandbula de un Homo an sin clasificar en el yacimiento de Atapuerca.40? En el siglo III a. C., se produjo la intervencin romana en la Pennsula, lo que conllev a una posterior conquista de lo que, ms tarde, se convertira en Hispania. En el Medievo, la zona fue conquistada por distintos pueblos germnicos y por los musulmanes, llegando estos a tener presencia durante algo ms de siete centurias. Es en el siglo XV, con la unin dinstica de las Coronas de Castilla y Aragn y la culminacin de la Reconquista, junto con la posterior anexin navarra, cuando se puede hablar de la cimentacin de Espaa, como era denominada en el exterior.41?42?43? Ya en la Edad Moderna, los monarcas espaoles gobernaron el primer imperio de ultramar global, que abarcaba territorios en los cinco continentes,nota 3? dejando un vasto acervo cultural y lingstico por el globo. A principios del xix, tras sucesivas guerras en Hispanoamrica, pierde la mayora de sus territorios en Amrica, acrecentndose esta situacin con el desastre del 98. Durante este siglo, se producira tambin una guerra contra el invasor francs, una serie de guerras civiles, una efmera repblica reemplazada nuevamente por una monarqua constitucional y el proceso de modernizacin del pas. En el primer tercio del siglo XX, se proclam una repblica constitucional. Un golpe de Estado militar fallido provoc el estallido de una guerra civil, cuyo fin dio paso a la dictadura de Francisco Franco, finalizada con la muerte de este en 1975, momento en que se inici una transicin hacia la democracia. Su clmax fue la redaccin, ratificacin en referndum y promulgacin de la Constitucin de 1978.nota 4? Acrecentado significativamente durante el llamado milagro econmico espaol, el desarrollo econmico y social del pas ha continuado a lo largo del vigente periodo democrtico.' , '243B551A-1715-40FA-9BEC-16EB25F4D3C4' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(396 , 18 , 1 , 'Patrimonio Mundial, ms conocido como Patrimonio de la Humanidad, es el ttulo conferido por Unesco a sitios especficos del planeta (sean bosque, montaa, lago, laguna, cueva, desierto, edificacin, complejo arquitectnico, ruta cultural, paisaje cultural o ciudad) que han sido propuestos y confirmados para su inclusin en la lista mantenida por el programa Patrimonio Mundial, administrado por el Comit del Patrimonio Mundial, compuesto por 21 Estados miembros a los que elige la Asamblea General de Estados miembros por un periodo determinado.1?  Placa conmemorativa de la inscripcin en la Lista del Patrimonio Mundial en Doana, Huelva  El objetivo del programa es catalogar, preservar y dar a conocer sitios de importancia cultural o natural excepcional para la herencia comn de la humanidad. Bajo ciertas condiciones, los sitios mencionados pueden obtener financiacin para su conservacin del Fondo para la conservacin del Patrimonio mundial. Fue fundado por la Convencin para la cooperacin internacional en la proteccin de la herencia cultural y natural de la humanidad, que posteriormente fue adoptada por la conferencia general de la Unesco el 16 de noviembre de 1972. Desde entonces, 193 Estados miembros han ratificado la convencin.' , '79A8B95F-6B39-4B2A-BE94-08269E1E5871' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(397 , 18 , 2 , 'Para julio de 2024, el catlogo consta de un total de 1223 sitios del Patrimonio Mundial, de los cuales 952 son culturales, 231 naturales y 40 mixtos, distribuidos en 168 pases.2?Por cantidad de sitios inscritos, los diez primeros pases son: Italia (60 sitios), China (59 sitios), Alemania (54 sitios), Francia (53 sitios), Espaa (50 sitios), India (43 sitios), Mxico y Reino Unido (ambos con 35 sitios), Rusia (32 sitios) e Irn (28 sitios).3? Castilla y Len y Andaluca (Espaa) son algunas de las regiones del mundo con ms bienes culturales Patrimonio Mundial, con 8; junto con las regiones de la Toscana, la Lombarda y el Veneto (Italia), las tres con 8 o ms bienes.4?5?6?  Histricamente, la inscripcin de los dos primeros bienes registrados en la Lista del Patrimonio Mundial en 1978, la Ciudad de Quito y las islas Galpagos, ambas ubicadas en Ecuador, se celebra cada 3 de diciembre en la Sede de la Unesco. Las islas Galpagos poseen la distincin de ser el primer bien natural declarado Patrimonio Mundial, mientras que la Ciudad de Quito, junto con el Centro histrico de Cracovia (Polonia), fueron los primeros centros histricos inscritos en la Lista.7?8?' , 'AACB7795-1D6C-4297-8A5F-7AD5A2B046DC' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(398 , 18 , 3 , 'La Ciudad de Quito fue inscrita en la Lista del Patrimonio Mundial bajo los criterios (ii) y (iv) por representar un importante intercambio de valores sociales entre los espaoles y las poblaciones indgenas, lo cual result en el desarrollo de un conjunto arquitectnico y monumental nico. Fundada en el siglo XVI sobre las ruinas de una ciudad inca, y a una altitud de 2850 m, la ciudad fue considerada por la comunidad del Patrimonio al momento de su inscripcin como el centro histrico mejor conservado y menos alterado en Amrica Latina.7?  Las islas Galpagos fueron inscritas en la Lista del Patrimonio Mundial bajo criterios (vii), (viii), (ix) y (x), mostrando un espectacular y nico sitio natural caracterizado por un extraordinario valor en vida silvestre y expresin excepcional de los periodos de la historia del planeta que no se encuentra en ningn otro lugar del mundo. Asimismo, el bien contiene ejemplos excepcionales de procesos ecolgicos y biolgicos de la evolucin de ecosistemas y hbitats para la conservacin in situ de la diversidad biolgica. Desde la publicacin de El viaje del Beagle, por Charles Darwin en 1839, el origen de la flora y la fauna de Galpagos ha sido de gran inters acadmico e importancia para la conservacin.7?8?' , '8E9F4924-5615-44BB-92CC-D59BE2DF4AC5' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(399 , 18 , 4 , 'La Unesco se refiere a cada sitio con un nmero de identificacin nico, pero las nuevas inscripciones incluyen a menudo los sitios anteriores ahora enumerados como parte de descripciones ms grandes. Consecuentemente, el sistema de numeracin termina actualmente sobre 1500, aunque realmente haya 1092 catalogados; con el aadido de que muchos de los Patrimonios de la Humanidad se encuentran en mltiples ubicaciones, siendo el mismo sitio, principalmente aquellos que son rutas culturales, conjuntos de un mismo concepto de sitio natural protegido, o paisajes culturales.  Cada sitio Patrimonio Mundial pertenece al pas en el que se localiza, pero se considera en el inters de la comunidad internacional y debe ser preservado para las futuras generaciones. La proteccin y la conservacin de estos sitios son una preocupacin de los 122 Estados miembros de la Unesco.' , '91F7E925-D535-474B-9E06-977539C6587E' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(400 , 19 , 1 , 'frica del Norte, frica septentrional o frica norsahariana (a veces llamada frica Blanca) es la subregin norte de frica. Est compuesta por cinco pases: Argelia, Egipto, Libia, Marruecos y Tnez. Adems, incluye a la Repblica rabe Saharaui Democrtica (que es un Estado con reconocimiento limitado) y otros territorios que dependen de pases externos a la subregin: Canarias, Ceuta y Melilla (que dependen de Espaa), Madeira (de Portugal) y Lampedusa e Linosa (de Italia).  Esta subregin limita al norte con el mar Mediterrneo, al este con el mar Rojo, al sur con frica Oriental, frica Central y frica Occidental, y al oeste con el ocano Atlntico.  El Magreb es parte de frica noroccidental.' , '48B2325A-66C8-4F40-8C29-012102EFB6AD' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(401 , 20 , 1 , 'Haba una vez un nio llamado Peter Pan. Peter viva en un lugar mgico llamado Nunca Jams. En este lugar, los nios nunca crecan. Peter Pan poda volar y siempre estaba acompaado por su amiga, un hada pequea llamada Campanilla.  Una noche, Peter Pan vol hasta la casa de una nia llamada Wendy y sus hermanos, Juan y Miguel. Peter los invit a viajar con l a Nunca Jams. Wendy, Juan y Miguel aceptaron y, con la ayuda del polvo mgico de Campanilla, comenzaron a volar.  En Nunca Jams, vivan los Nios Perdidos, que eran amigos de Peter. Tambin haba piratas malos, liderados por el Capitn Garfio, quien siempre quera atrapar a Peter Pan. El capitn Garfio tena un gancho en lugar de una mano, porque Peter se la cort en una pelea y se la dio a un cocodrilo.  Los nios vivieron muchas aventuras en Nunca Jams, pero Wendy y sus hermanos comenzaron a extraar su hogar. Decidieron regresar con Peter Pan, pero el Capitn Garfio los atrap.  Con la ayuda de Campanilla, Peter Pan rescat a Wendy, Juan y Miguel. Finalmente, los nios regresaron a casa, pero Peter Pan decidi quedarse en Nunca Jams, donde poda seguir siendo un nio para siempre.' , 'ACB68B7C-6F64-4B38-903A-3285B994DCB7' );
INSERT INTO [Idioma].[Page](Id, [BookId],[Ordinal],[OriginalText],[UniqueKey])VALUES(402 , 21 , 1 , 'Pap Noel, conocido tambin como Santa Claus (en neerlands: Sinterklaas), Viejito Pascuero,9? Colacho,10? San Nicols11? o simplemente Santa, es un personaje legendario12? originario del cristianismo occidental, conocido por repartir regalos a nios durante las noches de Nochebuena y Navidad (24 y 25 de diciembre). Estos regalos pueden contener juguetes, golosinas, carbn o simplemente nada, dependiendo de si el infante se encuentra en la lista de nios buenos o malos.13?14? Segn la leyenda, Pap Noel fabrica los regalos con ayuda de sus elfos, con los que trabaja en su taller, repartiendo los regalos con ayuda de sus renos que tiran de su trineo por el aire.15?16?  El personaje de Pap Noel est inspirado en tradiciones folclricas destacadas de personajes como Nicols de Bari (como tambin de su versin legendaria hngara, Mikuls)17?18? por parte del folclore europeo,19? la personificacin de la Navidad segn el folclore ingls de Pap Noel, y la figura neerlandesa de Sinterklaas.' , 'B6DAC296-A6DD-43BF-9B2D-B6E52647F0D5' );
