INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24402 , 14598 , 0 , 'Aladino y la lmpara mgica' , 'A1CA9846-9D39-43B6-8988-DFB6A32CAC75' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24403 , 14599 , 0 , 'Haba una vez, en una ciudad de Arabia, un joven llamado Aladino.' , '96C36F49-CBEE-4E76-8018-E7FD4F5C407E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24404 , 14599 , 1 , 'Viva con su madre en una pequea casa.' , '74025ED8-2233-41D0-BD48-169BBE2550F4' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24405 , 14599 , 2 , 'Eran pobres, pero Aladino siempre soaba con ser rico.' , '56D1E536-B573-4879-8E26-0F0F930F5331' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24406 , 14600 , 0 , 'Un da, un hombre extrao lleg a la ciudad.' , 'CE2A92F0-5DB6-4187-9BC2-CFFE051AE98C' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24407 , 14600 , 1 , 'Este hombre era un mago malo.' , '4480BA3F-43E5-4089-8158-5F057DCD6E6A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24408 , 14600 , 2 , 'Dijo que era el to de Aladino y lo llev al desierto.' , 'C203B9F9-B842-4D04-8251-9CC02E215FE3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24409 , 14600 , 3 , 'All, el mago le mostr una cueva mgica.' , 'CA4E7B35-041E-4DB0-9928-8BCE6BE366D3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24410 , 14601 , 0 , 'Aladino, entra en la cueva y trae la lmpara que est dentro, dijo el mago.' , '6D7786B6-52C2-447B-BCE3-4C8EA46BF25A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24411 , 14602 , 0 , 'Aladino entr en la cueva y encontr la lmpara.' , '9A4F84A6-0C6A-4E25-B8BA-6F25C096962A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24412 , 14602 , 1 , 'Pero cuando sali, el mago le pidi la lmpara antes de ayudarlo a salir de la cueva.' , '6DEFE519-D2C4-48FA-B635-9F6F21A42169' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24413 , 14602 , 2 , 'Aladino no confi en l y no le dio la lmpara.' , '9C3AE6BE-6504-4534-A7A3-862789849C07' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24414 , 14602 , 3 , 'Entonces, el mago, enojado, cerr la cueva, dejando a Aladino atrapado.' , 'D87D760F-CA6C-44AF-8FB1-DC129768AF1E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24415 , 14603 , 0 , 'Aladino estaba triste y asustado.' , 'D7A2FBCF-2A3B-45B9-8B71-75C5E3DF61B5' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24416 , 14603 , 1 , 'Mientras miraba la lmpara, la frot por accidente.' , '014D78FC-EF6A-48A7-BB98-5A3F3295555C' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24417 , 14603 , 2 , 'De repente, un genio apareci!' , '7A6A0F1C-5D50-433E-B6A9-BCF917991B8E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24418 , 14604 , 0 , 'Soy el genio de la lmpara.' , '80DC6FBA-30C1-41E5-89FF-426464B2E9CD' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24419 , 14604 , 1 , 'Cul es tu deseo?' , 'D279013D-11CC-468D-9E17-9823A330AF4F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24420 , 14604 , 2 , ', dijo el genio.' , '87B32B25-9727-400C-B9DD-1FB4B75AA710' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24421 , 14605 , 0 , 'Aladino pidi salir de la cueva, y el genio lo llev a casa con su madre.' , 'CF62BCA8-273D-4170-A966-D100E8049F34' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24422 , 14605 , 1 , 'Ahora, con la lmpara mgica, Aladino y su madre vivan mejor.' , 'D2B6FDAB-772B-4F21-9AB8-BC2D64C52BB1' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24423 , 14605 , 2 , 'Aladino pidi al genio muchos deseos: una casa grande, ropa bonita, y comida deliciosa.' , '00A26442-EC3C-4650-998F-BF10F9510EB7' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24424 , 14606 , 0 , 'Un da, Aladino vio a la princesa en el mercado y se enamor de ella.' , 'D52335D4-704F-4440-94F2-D1E168ECEAAA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24425 , 14606 , 1 , 'Quera casarse con ella, as que pidi al genio que lo ayudara.' , '9528434D-6B85-4431-A3F4-4BD0099F9B72' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24426 , 14606 , 2 , 'El genio le dio regalos maravillosos para el sultn, y Aladino pudo casarse con la princesa.' , 'B0753FE3-7223-48E0-B214-D9A17E40A3DA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24427 , 14607 , 0 , 'Pero el mago malo regres.' , '4AB446D3-A601-442F-924B-6DD39CB6F0E9' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24428 , 14607 , 1 , 'Quera la lmpara, as que enga a la princesa para que se la diera.' , '31D62EA1-DCB0-47DC-9986-866053C0E64F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24429 , 14607 , 2 , 'Con la lmpara en sus manos, el mago us el poder del genio para llevarse todo lo que Aladino tena, incluso su palacio y la princesa.' , 'C91BF1EB-D4FC-4D19-98B6-2D4DFC26F7F2' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24430 , 14608 , 0 , 'Aladino estaba triste, pero no se rindi.' , 'DCBC5E38-C9F7-439C-BFC4-A915DAF4D192' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24431 , 14608 , 1 , 'Con la ayuda de un anillo mgico que tambin tena un genio, logr encontrar al mago.' , '87912CDA-D3C5-470E-B08E-849960F1AB1F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24432 , 14608 , 2 , 'Enga al mago y recuper la lmpara.' , '4CF06EAD-FF90-4109-A463-3B86DE91D0D4' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24433 , 14608 , 3 , 'Aladino volvi a pedir sus deseos al genio, y todo regres a la normalidad.' , 'C988F9D4-DDFB-49B1-8B93-3B9D743B62FC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24434 , 14609 , 0 , 'Al final, Aladino y la princesa vivieron felices para siempre, y nunca ms usaron la lmpara mgica.' , '1F097648-EA89-46FB-ACFD-C85D6748828F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24435 , 14610 , 0 , 'Cenicienta' , '2EA8BA50-E51C-41BC-9D58-7C71390F5849' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24436 , 14611 , 0 , 'Haba una vez una joven llamada Cenicienta.' , 'B79B06AE-87C0-4857-AE17-E660E59CBCF2' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24437 , 14611 , 1 , 'Ella viva con su madrastra y dos hermanastras.' , '21B3F249-DE1B-422C-9B0B-E209AF5261C7' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24438 , 14611 , 2 , 'Ellas eran muy crueles con Cenicienta y la hacan trabajar todo el da limpiando la casa.' , 'EF95C4CC-D9DC-4A24-BBAE-81EA0CA7467B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24439 , 14612 , 0 , 'Un da, el prncipe organiz un gran baile en el palacio.' , '6FE34F0C-ABBB-469A-965B-848E26B7B526' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24440 , 14612 , 1 , 'Todas las jvenes del reino estaban invitadas.' , '3BB81A9D-B1D4-4EFF-9CA5-553560BDB7BC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24441 , 14612 , 2 , 'Las hermanastras de Cenicienta fueron al baile, pero no dejaron que Cenicienta fuera.' , 'E3DD51D1-2A99-45E0-9506-C4425A5470EB' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24442 , 14613 , 0 , 'Cenicienta estaba muy triste.' , 'ADEE09B9-E868-45AA-9E86-FFC52CB390DA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24443 , 14613 , 1 , 'De repente, apareci su hada madrina.' , '74CC1264-FC2F-4EAD-AD36-C6926A94004F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24444 , 14613 , 2 , 'Con su varita mgica, transform un calabaza en un bonito carruaje, a los ratones en caballos, y a Cenicienta le dio un vestido precioso y unos zapatos de cristal.' , '13524454-DF01-4796-983D-FF838DA57B26' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24445 , 14613 , 3 , 'Pero le advirti que deba volver antes de la medianoche, porque a esa hora el hechizo se rompera.' , '58ED0701-48D0-400A-AE7A-B7F3EE50B6A8' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24446 , 14614 , 0 , 'Cenicienta fue al baile y el prncipe qued enamorado de ella.' , '9EC90843-2911-484E-A085-83A507B3F91D' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24447 , 14614 , 1 , 'Bailaron toda la noche, pero cuando el reloj marc la medianoche, Cenicienta tuvo que salir corriendo.' , '76C7C8F6-C260-46FF-A562-92016BFA4335' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24448 , 14614 , 2 , 'En su prisa, perdi uno de sus zapatos de cristal.' , 'A324D405-6AA6-4BD8-99A1-74B4FD14A373' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24449 , 14615 , 0 , 'El prncipe, decidido a encontrarla, busc por todo el reino a la duea del zapato.' , '7A0F264A-0908-4841-8900-08BC676CDDC3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24450 , 14615 , 1 , 'Finalmente, lleg a la casa de Cenicienta.' , '7F18CA1B-C1F3-41BF-87E4-9EC36CC7219E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24451 , 14615 , 2 , 'Las hermanastras intentaron ponerse el zapato, pero no les quedaba bien. Entonces, Cenicienta se lo prob, y le qued perfecto.' , '441087C0-3F92-4508-B082-3F178A924A7B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24452 , 14616 , 0 , 'El prncipe y Cenicienta se casaron y vivieron felices para siempre.' , '7B9E7B70-3C07-4A16-812F-21517B9EE22A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24453 , 14617 , 0 , 'Ananse y la Olla de Sabidura' , '8073B674-0A67-4419-9CFE-5AC686549D99' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24454 , 14618 , 0 , 'Haba una vez, en un pueblo lejano, una araa muy lista llamada Ananse.' , 'C91EC379-8331-4830-B859-78555608DDBC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24455 , 14618 , 1 , 'Un da, Ananse decidi que quera tener toda la sabidura del mundo para l solo.' , 'D15FB19B-3585-47AA-A73A-BC8BC4F406CD' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24456 , 14618 , 2 , 'Entonces, fue al bosque y encontr una olla mgica que contena toda la sabidura.' , '83D1D409-02C6-4534-AA05-247B741761AE' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24457 , 14619 , 0 , 'Ananse estaba muy feliz.' , 'BFC735B9-05C6-41B2-9180-CB42E83FB896' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24458 , 14619 , 1 , 'Pens: "Voy a guardar esta olla para m. Ser el ms sabio de todos."' , 'DCE81D3A-2FCD-4068-9445-2E14A5BFB92C' );
