INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24474 , 14628 , 0 , 'Msica animada, fondo colorido con el ttulo "Comprehensible Input: El MEJOR Mtodo para Aprender un Idioma!"' , '61783DA2-CB45-485A-B796-180769E82365' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24475 , 14629 , 0 , '[EN PANTALLA: Aparece el YouTuber sonriendo, de pie frente a un fondo simple con imgenes relacionadas con el aprendizaje de idiomas, como libros, nubes de palabras y banderas. Aparece el subttulo "Explicacin de Comprehensible Input".]' , '2E6C4E89-5E41-46F8-8516-0FAA232B592E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24476 , 14630 , 0 , 'YouTuber' , '6CF669A9-909C-42CA-BBB4-F62AFC86B285' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24477 , 14631 , 0 , '"Hola, qu tal, estudiantes de idiomas! Bienvenidos de nuevo al canal, donde hablamos de los MEJORES mtodos para aprender idiomas rpido y de forma efectiva. Si eres nuevo aqu, no olvides darle al botn de suscribirse y activar las notificaciones porque hoy vamos a hablar de una de las herramientas ms poderosas para aprender cualquier idioma: comprehensible input!"' , 'F334B103-93C2-4DCA-859A-5E123B29C89B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24478 , 14632 , 0 , '[SECCIN 1: Qu es el Comprehensible Input?]' , '066C7B12-13B4-48CB-8732-5D9E728815DE' );
