INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24481 , 14635 , 0 , '"Bien, entonces, qu es el comprehensible input o entrada comprensible?' , '0810AAEE-1DB9-4DF2-BBD8-DAB46AFCC26D' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24482 , 14635 , 1 , 'Puede que hayas escuchado este trmino si ests en el mundo del aprendizaje de idiomas.' , 'FA2A377B-EF6B-4A05-BD87-76E23E95962F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24483 , 14635 , 2 , 'Es un mtodo popularizado por el lingista Stephen Krashen, que se basa en la idea de que aprendemos mejor un idioma cuando entendemos lo que estamos escuchando o leyendo, aunque no sepamos cada palabra.' , '8A9CF54C-DC8D-4908-9724-8CC4D2FE8AD4' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24484 , 14636 , 0 , 'El comprehensible input bsicamente significa exponerse a un idioma que est un poco por encima de tu nivel actual.' , 'EFAFDB1E-DBC1-4FB4-89D0-3DA605E61ABC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24485 , 14636 , 1 , 'No demasiado fcil, porque no te desafiara, pero tampoco tan difcil que te pierdas por completo.' , '51350486-2EEA-44D0-ABDC-785754086987' );
