INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24562 , 14685 , 0 , 'Golpe de Estado en Espaa de 1981' , 'CB2759AC-9FA4-42A1-913D-720E7A12C37F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24563 , 14686 , 0 , 'El golpe de Estado de 1981, tambin conocido por el numernimo 23F,?' , '86E06215-D9FB-416F-9DEE-3888DC70F6AA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24564 , 14686 , 1 , 'fue un intento fallido de golpe de Estado perpetrado el lunes 23 de febrero de 1981 por algunos mandos militares en Espaa.' , '4C93B9EF-7CFF-489F-A9B2-57A51E0A5CFA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24565 , 14686 , 2 , 'Los hechos principales sucedieron en las ciudades de Valencia y Madrid.' , '701F68CE-AD24-4CF6-B812-10E7AA3BC16C' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24566 , 14687 , 0 , 'En Madrid, a las 18:23 horas, un numeroso grupo de guardias civiles a cuyo mando se encontraba el teniente coronel Antonio Tejero asalt el Palacio de las Cortes durante la votacin para la investidura del candidato a la Presidencia del Gobierno, Leopoldo Calvo-Sotelo, hasta entonces vicepresidente segundo del Gobierno y diputado de la Unin de Centro Democrtico (UCD).' , '0041464E-5B51-4931-B71C-296B0BA6FB76' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24567 , 14687 , 1 , 'Los diputados y el Gobierno de Espaa al completo fueron secuestrados en su interior.' , '177FA7EC-E2BB-4B12-BEA1-B9AE09E3CB8F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24568 , 14688 , 0 , 'La ciudad de Valencia fue ocupada militarmente, en virtud del estado de excepcin proclamado por el teniente general Jaime Milans del Bosch, capitn general de la III regin militar.' , '6D80211B-804B-4E33-A48E-0F5A31F50E15' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24569 , 14688 , 1 , 'Dos mil hombres y cincuenta carros de combate fueron desplegados en las calles de la ciudad.' , 'ED37F342-53B1-4959-B79D-A0A580C18334' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24570 , 14689 , 0 , 'A las 21 horas de ese mismo da, el diario El Pas puso en la calle una edicin especial posicionndose contra el golpe con el titular en primera plana: El Pas, con la Constitucin.' , '221F0032-D4E0-4A71-8C5F-8E30826845BE' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24571 , 14689 , 1 , '? A la una de la madrugada del 24 de febrero, el rey Juan Carlos I, vestido con uniforme de capitn general de los Ejrcitos, se dirigi a la nacin por televisin para situarse en contra de los golpistas y defender la Constitucin espaola.' , '1E9F0886-FDC9-48D4-B6D0-3D7421CBBA89' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24572 , 14689 , 2 , 'Poco despus, Milans dio la orden de regresar a sus unidades a los contingentes militares que ocupaban Valencia.' , 'D0B9E35D-A2B7-4E56-9164-F010239154C1' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24573 , 14689 , 3 , 'El secuestro del Congreso termin a medioda del da 24.' , 'AEA6839E-74CD-4802-867D-606418D70250' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24574 , 14690 , 0 , 'El Tribunal Supremo, en casacin, conden a 30 aos de crcel a Milans, Tejero y Alfonso Armada como principales responsables del golpe de Estado.' , '0A8B7E8C-0616-4F14-A193-CFD77D7A37E0' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24575 , 14690 , 1 , 'En total fueron condenados doce miembros de las Fuerzas Armadas, diecisiete miembros de la Guardia Civil y un civil.' , '46D1B63D-1B37-4CCF-9E9F-F4CD147C1BCA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24576 , 14690 , 2 , 'Menos Tejero, todos ellos salieron de la prisin antes del ao 1990 (el general Armada gracias a un indulto).' , '0D8DF54F-B33E-49E0-9400-3358BA95AC4F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24577 , 14691 , 0 , 'Como ha destacado Juan Francisco Fuentes, el estrepitoso fracaso del golpe trajo consigo la consolidacin de una democracia tambaleante y la derrota definitiva del golpismo, del que puede decirse que ya nunca levant cabeza.' , '8D9FBF38-79EF-424A-ADB0-C7528A2A020C' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24578 , 14691 , 1 , '? El 23-F fue el resultado de una tradicin militarista que muri con l, aade Fuentes.' , 'DBACB1E3-ECEA-4A42-B2E8-DAEC6D5766A5' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24579 , 14692 , 0 , 'Espaa, formalmente Reino de Espaa,nota 1?' , '308E78F0-92D4-431A-A649-DF319B6054A0' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24580 , 14692 , 1 , 'es un pas soberano transcontinental, constituido en Estado social y democrtico de derecho y cuya forma de gobierno es la monarqua parlamentaria.' , 'F916B219-9281-4AAC-ADDE-472D6A4A6F63' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24581 , 14692 , 2 , 'Es uno de los veintisiete Estados soberanos que forman la Unin Europea.' , '9C355308-44E3-4964-BA4F-0BB0D0E7692F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24582 , 14692 , 3 , 'Su territorio, con capital en Madrid,30?' , '35CE438F-93C5-46D0-B6FA-F231282A9227' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24583 , 14692 , 4 , 'est organizado en diecisiete comunidades autnomas, formadas a su vez por cincuenta provincias, y dos ciudades autnomas.' , '63A479A8-E084-4944-AB8A-6C0E6F184617' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24584 , 14693 , 0 , 'Espaa se sita principalmente en el suroeste de Europa, si bien tambin tiene presencia en el norte de frica.' , '68F01067-86CC-4192-A481-816E54B68189' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24585 , 14693 , 1 , 'En Europa, ocupa la mayor parte de la pennsula ibrica, conocida como Espaa peninsular, y las islas Baleares (en el mar Mediterrneo).' , '1B744911-03EE-47B7-91F6-51FF60F018C7' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24586 , 14693 , 2 , 'En frica se hallan las ciudades de Ceuta y Melilla, las islas Canarias (en el ocano Atlntico) y varias posesiones mediterrneas denominadas plazas de soberana.' , '523C548F-AE6D-4F35-90E0-3BFADDA6AE92' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24587 , 14693 , 3 , 'El municipio de Llivia, en los Pirineos, constituye un exclave rodeado totalmente por territorio francs.' , '41B90076-6E5D-431F-ABA0-3A4A169A697E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24588 , 14693 , 4 , 'Completa el conjunto de territorios una serie de islas e islotes frente a las propias costas peninsulares.' , 'C8D8F027-A4C1-4C3B-9F67-77748922C04D' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24589 , 14693 , 5 , 'Tiene una extensin de 505 370 km2,11?' , '7F15FBB6-DCCD-476D-9B21-778CAC493D2F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24590 , 14693 , 6 , 'por lo que es el cuarto pas ms extenso del continente,nota 2?' , '9329059C-0DE7-41B4-9718-BE9FCF58C1F3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24591 , 14693 , 7 , 'y con una altitud media de 650 m sobre el nivel del mar, uno de los pases ms montaosos de Europa.' , '2FF4F97A-14AB-4E75-B6C1-B4337D078618' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24592 , 14693 , 8 , 'Su poblacin casi llega a los 48 millones y medio de habitantes, aunque la densidad de poblacin es reducida si se compara con el contexto europeo.31?' , '05E1A6F3-AAA4-4A3F-A37D-F54410CF09C2' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24593 , 14693 , 9 , '32?' , 'E907F35B-274C-47D9-9C8C-3455D68DFA49' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24594 , 14693 , 10 , 'Concretamente, a 1 de julio de 2024 lleg hasta los 48 797 897.13?' , '1B148FA2-821C-4735-844A-70DA4CECFCED' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24595 , 14693 , 11 , 'El territorio peninsular comparte fronteras terrestres con Francia y con Andorra al norte, con Portugal al oeste y con Gibraltar al sur.' , '0937C5C2-6488-4A11-B5DE-8DF0778CC37D' );
