INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24597 , 14693 , 13 , 'Comparte con Francia la soberana sobre la isla de los Faisanes en la desembocadura del ro Bidasoa y cinco faceras pirenaicas.33?' , 'F9360D2E-480C-4213-8DC0-58F0268FA231' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24598 , 14694 , 0 , 'El artculo 3.1 de su Constitucin establece que el castellano es la lengua espaola oficial del Estado. Todos los espaoles tienen el deber de conocerla y el derecho a usarla.3?' , 'DDF4261B-3919-4DBA-B2B7-697315B0861D' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24599 , 14694 , 1 , 'En 2012, era la lengua materna del 82 % de los espaoles.34?' , 'F689B7D8-3D21-4E70-B8C1-519B8FD53070' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24600 , 14694 , 2 , 'Segn el artculo 3.2, las dems lenguas espaolas sern tambin oficiales en las respectivas Comunidades Autnomas de acuerdo con sus Estatutos.3?' , 'E0BA5FE3-FFD8-4307-AECF-B69B3A6B184D' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24601 , 14694 , 3 , 'El idioma espaol o castellano, segunda lengua materna ms hablada del mundo con 500 millones de hispanohablantes nativos, y hasta casi los 600 millones incluyendo hablantes con competencia limitada,35?' , '393DBE32-37DC-4F07-84F0-F8C61D2B89F9' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24602 , 14694 , 4 , 'es uno de los ms importantes legados del acervo cultural e histrico de Espaa en el mundo.' , '434A03E2-2053-4F1F-82EC-97C9EAA5F840' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24603 , 14694 , 5 , 'Perteneciente culturalmente a la Europa Latina y heredero de una vasta influencia grecorromana, Espaa alberga tambin la cuarta coleccin ms numerosa del mundo de sitios declarados Patrimonio de la Humanidad por la Unesco.36?' , '540EDCBD-F956-4C15-B4F9-2079D9BCD43F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24604 , 14695 , 0 , 'Es un pas desarrollado goza de la cuarta esperanza de vida ms elevada del mundo y de altos ingresos, cuyo producto interior bruto coloca a la economa espaola en la decimocuarta posicin mundial (2021).37?' , '6B3A2495-186D-4A2E-9EAD-BDBC03420AEC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24605 , 14695 , 1 , 'Espaa es una gran potencia turstica, ya que destaca como el segundo pas ms visitado del mundo ms de 83 millones de turistas en 2019 y el segundo pas del mundo en ingresos econmicos provenientes del turismo internacional.38?' , 'ADEA8F58-B063-4020-96A3-163E0FB1F3F4' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24606 , 14695 , 2 , '39?' , '5C19F744-9EC0-4CDE-B336-F979108BC9EA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24607 , 14695 , 3 , 'Tiene un ndice de desarrollo humano muy alto (0,911), segn el informe de 2022 del Programa de la ONU para el Desarrollo.15?' , '12571E13-F8F4-49B8-9202-75A619BA08A3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24608 , 14695 , 4 , 'Espaa tambin tiene una notable proyeccin internacional a travs de su pertenencia a mltiples organizaciones internacionales como Naciones Unidas, el Consejo de Europa, la Organizacin Mundial del Comercio, la Organizacin de Estados Iberoamericanos, la OCDE, la OTAN y la Unin Europea incluidos dentro de esta al espacio Schengen y la eurozona, adems de ser miembro de facto del G20.' , 'E9A895CF-7E56-45DE-ACB2-A28D8D4AFBDF' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24609 , 14696 , 0 , 'La primera presencia constatada de homnidos del gnero Homo se remonta a 1,2 millones de aos antes del presente, como atestigua el descubrimiento de una mandbula de un Homo an sin clasificar en el yacimiento de Atapuerca.40?' , 'B1E45BEF-08AF-4444-A061-F3CA2558ABB4' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24610 , 14696 , 1 , 'En el siglo III a. C., se produjo la intervencin romana en la Pennsula, lo que conllev a una posterior conquista de lo que, ms tarde, se convertira en Hispania.' , 'D3503195-09C8-470B-8EAE-DB137889AA29' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24611 , 14696 , 2 , 'En el Medievo, la zona fue conquistada por distintos pueblos germnicos y por los musulmanes, llegando estos a tener presencia durante algo ms de siete centurias.' , 'F7A2FA5B-CDDF-4DCF-BA82-4F7D0D6BC9DC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24612 , 14696 , 3 , 'Es en el siglo XV, con la unin dinstica de las Coronas de Castilla y Aragn y la culminacin de la Reconquista, junto con la posterior anexin navarra, cuando se puede hablar de la cimentacin de Espaa, como era denominada en el exterior.41?' , '3802D908-0024-42AC-B81E-C0212A0EEC84' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24613 , 14696 , 4 , '42?' , 'D4D9F2A6-E138-4C49-A1C9-83CD41745215' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24614 , 14696 , 5 , '43?' , '4E6B5F82-EEF7-4A6B-A007-031144D1808B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24615 , 14696 , 6 , 'Ya en la Edad Moderna, los monarcas espaoles gobernaron el primer imperio de ultramar global, que abarcaba territorios en los cinco continentes,nota 3?' , 'C5722799-0A08-47F8-89D2-D844579DE75C' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24616 , 14696 , 7 , 'dejando un vasto acervo cultural y lingstico por el globo.' , '6DC03C40-DDBC-4176-A674-FC4597E975E0' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24617 , 14696 , 8 , 'A principios del xix, tras sucesivas guerras en Hispanoamrica, pierde la mayora de sus territorios en Amrica, acrecentndose esta situacin con el desastre del 98.' , '7D786E21-C94D-46FB-9815-2B1BF33DD86F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24618 , 14696 , 9 , 'Durante este siglo, se producira tambin una guerra contra el invasor francs, una serie de guerras civiles, una efmera repblica reemplazada nuevamente por una monarqua constitucional y el proceso de modernizacin del pas.' , 'BFCCA66E-B7C3-4304-B514-2D78E1E3AE6F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24619 , 14696 , 10 , 'En el primer tercio del siglo XX, se proclam una repblica constitucional.' , '80350930-B638-485B-A2EF-4BF33DFBAE3F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24620 , 14696 , 11 , 'Un golpe de Estado militar fallido provoc el estallido de una guerra civil, cuyo fin dio paso a la dictadura de Francisco Franco, finalizada con la muerte de este en 1975, momento en que se inici una transicin hacia la democracia.' , '86976096-06B6-47A2-B0D4-A027960A5BBB' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24621 , 14696 , 12 , 'Su clmax fue la redaccin, ratificacin en referndum y promulgacin de la Constitucin de 1978.nota 4?' , 'AF791602-67CF-4DB5-8E81-5B65982217CD' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24622 , 14696 , 13 , 'Acrecentado significativamente durante el llamado milagro econmico espaol, el desarrollo econmico y social del pas ha continuado a lo largo del vigente periodo democrtico.' , '3C3216EC-4928-4772-A5EC-F9973A382E1E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24623 , 14697 , 0 , 'Patrimonio Mundial, ms conocido como Patrimonio de la Humanidad, es el ttulo conferido por Unesco a sitios especficos del planeta (sean bosque, montaa, lago, laguna, cueva, desierto, edificacin, complejo arquitectnico, ruta cultural, paisaje cultural o ciudad) que han sido propuestos y confirmados para su inclusin en la lista mantenida por el programa Patrimonio Mundial, administrado por el Comit del Patrimonio Mundial, compuesto por 21 Estados miembros a los que elige la Asamblea General de Estados miembros por un periodo determinado.1?' , '16AB02D8-EACC-4AD0-B78C-C0598342F31B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24624 , 14698 , 0 , 'Placa conmemorativa de la inscripcin en la Lista del Patrimonio Mundial en Doana, Huelva' , '073544AE-0B4A-4FFF-8E84-A78DAAEFC66B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24625 , 14699 , 0 , 'El objetivo del programa es catalogar, preservar y dar a conocer sitios de importancia cultural o natural excepcional para la herencia comn de la humanidad.' , 'BBAA5CAA-7E61-4297-806F-E728C3DF4C27' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24626 , 14699 , 1 , 'Bajo ciertas condiciones, los sitios mencionados pueden obtener financiacin para su conservacin del Fondo para la conservacin del Patrimonio mundial.' , '55FA00B6-1BC0-4CCB-9264-975F27DCCF60' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24627 , 14699 , 2 , 'Fue fundado por la Convencin para la cooperacin internacional en la proteccin de la herencia cultural y natural de la humanidad, que posteriormente fue adoptada por la conferencia general de la Unesco el 16 de noviembre de 1972.' , 'C14D43DB-695A-4BBD-AF14-EF5D376655E3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24628 , 14699 , 3 , 'Desde entonces, 193 Estados miembros han ratificado la convencin.' , 'D58645F6-996A-4C93-8EBF-90987BCF8584' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24629 , 14700 , 0 , 'Para julio de 2024, el catlogo consta de un total de 1223 sitios del Patrimonio Mundial, de los cuales 952 son culturales, 231 naturales y 40 mixtos, distribuidos en 168 pases.2?' , '0D68E000-77B4-45F1-8BE2-5A54A6B242F3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24630 , 14700 , 1 , 'Por cantidad de sitios inscritos, los diez primeros pases son: Italia (60 sitios), China (59 sitios), Alemania (54 sitios), Francia (53 sitios), Espaa (50 sitios), India (43 sitios), Mxico y Reino Unido (ambos con 35 sitios), Rusia (32 sitios) e Irn (28 sitios).3?' , '410A7562-028C-491A-83F0-C940267E14FA' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24631 , 14700 , 2 , 'Castilla y Len y Andaluca (Espaa) son algunas de las regiones del mundo con ms bienes culturales Patrimonio Mundial, con 8; junto con las regiones de la Toscana, la Lombarda y el Veneto (Italia), las tres con 8 o ms bienes.4?' , '4E46EB29-6222-405B-BEEF-44B49DB88099' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24632 , 14700 , 3 , '5?' , 'A8831D90-2A48-4482-B082-0BF0BC9D18CC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24633 , 14700 , 4 , '6?' , 'D98BF9AF-0DB4-4B40-BC37-4E3257B79AAD' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24634 , 14701 , 0 , 'Histricamente, la inscripcin de los dos primeros bienes registrados en la Lista del Patrimonio Mundial en 1978, la Ciudad de Quito y las islas Galpagos, ambas ubicadas en Ecuador, se celebra cada 3 de diciembre en la Sede de la Unesco.' , 'AB0253C2-1E0A-4955-AEBE-CE8C1588F3AC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24635 , 14701 , 1 , 'Las islas Galpagos poseen la distincin de ser el primer bien natural declarado Patrimonio Mundial, mientras que la Ciudad de Quito, junto con el Centro histrico de Cracovia (Polonia), fueron los primeros centros histricos inscritos en la Lista.7?' , '38EF43F8-1DC9-4C52-9BE4-5881311E0D8F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24636 , 14701 , 2 , '8?' , '9D215A0F-0DC6-4DA9-96C0-3F208DB01EC5' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24637 , 14702 , 0 , 'La Ciudad de Quito fue inscrita en la Lista del Patrimonio Mundial bajo los criterios (ii) y (iv) por representar un importante intercambio de valores sociales entre los espaoles y las poblaciones indgenas, lo cual result en el desarrollo de un conjunto arquitectnico y monumental nico.' , 'D1B6C9FC-2F8F-4E63-9479-1B769A817A1B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24638 , 14702 , 1 , 'Fundada en el siglo XVI sobre las ruinas de una ciudad inca, y a una altitud de 2850 m, la ciudad fue considerada por la comunidad del Patrimonio al momento de su inscripcin como el centro histrico mejor conservado y menos alterado en Amrica Latina.7?' , '92B91876-393A-4C2A-8682-55DBE9C60A5F' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24639 , 14703 , 0 , 'Las islas Galpagos fueron inscritas en la Lista del Patrimonio Mundial bajo criterios' , '085BBA2D-9740-412C-A3DD-316D0CAC9E18' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24640 , 14703 , 1 , '(vii),' , '2B7F717A-1524-40E3-84E5-6CEF3A70AD63' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24641 , 14703 , 2 , '(viii),' , 'E114FD12-DAB3-45E5-96CD-29675C7D8D91' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24642 , 14703 , 3 , '(ix) y' , '9F7668E6-67B6-4CE1-A893-DD87122ED715' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24643 , 14703 , 4 , '(x), mostrando un espectacular y nico sitio natural caracterizado por un extraordinario valor en vida silvestre y expresin excepcional de los periodos de la historia del planeta que no se encuentra en ningn otro lugar del mundo.' , '45341EEC-A14A-47D3-9192-6DE10EBE609A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24644 , 14703 , 5 , 'Asimismo, el bien contiene ejemplos excepcionales de procesos ecolgicos y biolgicos de la evolucin de ecosistemas y hbitats para la conservacin in situ de la diversidad biolgica.' , '2285DAA9-EC6E-4B97-AA19-40AD7D213EDD' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24645 , 14703 , 6 , 'Desde la publicacin de El viaje del Beagle, por Charles Darwin en 1839, el origen de la flora y la fauna de Galpagos ha sido de gran inters acadmico e importancia para la conservacin.7?' , '2118468C-F6B0-455D-A48D-EDB37E147A63' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24646 , 14703 , 7 , '8?' , '70A8BD45-89AD-44BF-BE98-F853B6687A56' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24647 , 14704 , 0 , 'La Unesco se refiere a cada sitio con un nmero de identificacin nico, pero las nuevas inscripciones incluyen a menudo los sitios anteriores ahora enumerados como parte de descripciones ms grandes.' , '3F9E279C-2A82-432C-A93E-8AA4009667FB' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24648 , 14704 , 1 , 'Consecuentemente, el sistema de numeracin termina actualmente sobre 1500, aunque realmente haya 1092 catalogados; con el aadido de que muchos de los Patrimonios de la Humanidad se encuentran en mltiples ubicaciones, siendo el mismo sitio, principalmente aquellos que son rutas culturales, conjuntos de un mismo concepto de sitio natural protegido, o paisajes culturales.' , '6EA5DCB3-963A-4CAD-85B1-2DDBD2EED852' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24649 , 14705 , 0 , 'Cada sitio Patrimonio Mundial pertenece al pas en el que se localiza, pero se considera en el inters de la comunidad internacional y debe ser preservado para las futuras generaciones.' , '821EBE39-0A2F-494D-BE2E-958ADDA46D90' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24650 , 14705 , 1 , 'La proteccin y la conservacin de estos sitios son una preocupacin de los 122 Estados miembros de la Unesco.' , '0E5BFADA-4707-4327-AA05-B67010B6DF0B' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24651 , 14706 , 0 , 'frica del Norte, frica septentrional o frica norsahariana (a veces llamada frica Blanca) es la subregin norte de frica.' , '304954E9-E14A-4707-B15A-E651B4C49830' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24652 , 14706 , 1 , 'Est compuesta por cinco pases: Argelia, Egipto, Libia, Marruecos y Tnez.' , '5B99BD8C-3C3D-4F23-AFF1-39ABCA5043B3' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24653 , 14706 , 2 , 'Adems, incluye a la Repblica rabe Saharaui Democrtica (que es un Estado con reconocimiento limitado) y otros territorios que dependen de pases externos a la subregin: Canarias, Ceuta y Melilla (que dependen de Espaa), Madeira (de Portugal) y Lampedusa e Linosa (de Italia).' , 'DD787A7C-6825-4DB3-8974-C4252313F0E8' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24654 , 14707 , 0 , 'Esta subregin limita al norte con el mar Mediterrneo, al este con el mar Rojo, al sur con frica Oriental, frica Central y frica Occidental, y al oeste con el ocano Atlntico.' , '9BC449CA-BDCC-4F58-9873-81B160E3373A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24655 , 14708 , 0 , 'El Magreb es parte de frica noroccidental.' , '20F0C9C6-3206-4F7F-A545-0CA19622E1CE' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24656 , 14709 , 0 , 'Haba una vez un nio llamado Peter Pan.' , '1147D23A-0B56-49AB-990E-30B2EEA7F86D' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24657 , 14709 , 1 , 'Peter viva en un lugar mgico llamado Nunca Jams.' , 'B60AA928-37D7-40E2-83C9-1E945DC5D13A' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24658 , 14709 , 2 , 'En este lugar, los nios nunca crecan.' , '86379202-459F-46D1-ADAE-5E2E788D9290' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24659 , 14709 , 3 , 'Peter Pan poda volar y siempre estaba acompaado por su amiga, un hada pequea llamada Campanilla.' , '203644EC-FE0D-4340-B691-CF78B087168E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24660 , 14710 , 0 , 'Una noche, Peter Pan vol hasta la casa de una nia llamada Wendy y sus hermanos, Juan y Miguel.' , 'DB95E88E-6310-4E90-973A-805685754E7E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24661 , 14710 , 1 , 'Peter los invit a viajar con l a Nunca Jams.' , '610E147C-A773-4EA4-9D08-D585E1C6FD40' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24662 , 14710 , 2 , 'Wendy, Juan y Miguel aceptaron y, con la ayuda del polvo mgico de Campanilla, comenzaron a volar.' , '034AF4FB-5D47-464C-B585-1D58D8785347' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24663 , 14711 , 0 , 'En Nunca Jams, vivan los Nios Perdidos, que eran amigos de Peter.' , 'A34BF5B2-E06E-4523-B04A-CC5F5BD71B3E' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24664 , 14711 , 1 , 'Tambin haba piratas malos, liderados por el Capitn Garfio, quien siempre quera atrapar a Peter Pan.' , 'B3564D07-684C-41AD-AF1B-390E3CFDF8F1' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24665 , 14711 , 2 , 'El capitn Garfio tena un gancho en lugar de una mano, porque Peter se la cort en una pelea y se la dio a un cocodrilo.' , '768637F4-1F8F-4723-BA52-123D6F158DC9' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24666 , 14712 , 0 , 'Los nios vivieron muchas aventuras en Nunca Jams, pero Wendy y sus hermanos comenzaron a extraar su hogar.' , '40E3C5B4-20D9-4795-874D-95744F00F247' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24667 , 14712 , 1 , 'Decidieron regresar con Peter Pan, pero el Capitn Garfio los atrap.' , '6523EB3E-B054-4BF3-A701-CA211953C651' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24668 , 14713 , 0 , 'Con la ayuda de Campanilla, Peter Pan rescat a Wendy, Juan y Miguel.' , '7C4E4F1E-0CD5-4409-AD24-B0B1A41DF2FC' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24669 , 14713 , 1 , 'Finalmente, los nios regresaron a casa, pero Peter Pan decidi quedarse en Nunca Jams, donde poda seguir siendo un nio para siempre.' , 'C1496072-E7F2-4CF5-BADF-4F91A4AC9032' );
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24670 , 14714 , 0 , 'Pap Noel, conocido tambin como Santa Claus (en neerlands: Sinterklaas), Viejito Pascuero,9?' , '6A2CB1B1-FDDE-4AF4-A508-A02D2807A1C1' );
