INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(24674 , 14714 , 4 , 'originario del cristianismo occidental, conocido por repartir regalos a nios durante las noches de Nochebuena y Navidad (24 y 25 de diciembre).' , '9B134BDF-C495-414E-B9E5-0064B647E36E' );
